Subj:
Право заключения государственных контрактов на выполнение дорожно-мостовых работ по ремонту мостов на автомобильных дорогах общего пользования регионального или межмуниципального значения Курганской области:
Лот№1- через р. Кизак на км 2 автомобильной дороги Мокроусово-Одино-Курган-Шелепово-Большое Щучье в Мокроусовском районе;
Лот №2- через р.Курея на км 87 автомобильной дороги "Курган-Половинное"-Воскресенское-граница Казахстана в Половинском районе.
